import React from 'react';
import Header from './Header';
import Team from './Teams/Team';
import Social from './SocialMedia/Social';
import HomeWork1 from './homeworks/Homework_1';

function App() {
    return(
      <div className = "container">
          <Header />
          <Social />
          <HomeWork1 />
          <Team />
      </div>
    );
}

export default App;
